import{_ as t,o as e,c as i,R as l}from"./chunks/framework.o-1c6b6b.js";const u=JSON.parse('{"title":"","description":"","frontmatter":{},"headers":[],"relativePath":"blog/diary/test.md","filePath":"blog/diary/test.md","lastUpdated":1737441784000}'),a={name:"blog/diary/test.md"},p=l("<ul><li><p>生活总是苦的，这就是我们为什么一遇到点甜就奋不顾身的原因。</p></li><li><p>告别一段旅程，未来该何去何从，没有明确的答案，只是在日益变老的年纪里，没有抓住童年的那只蝉，注定错过了那整个的夏天。</p></li><li><p>不要咒骂当初的自己，当时的他一个人站在迷雾里，也很迷茫。</p></li><li><p>流星，或许就是一颗迷路的星星。</p></li><li><p>以前我总以为自己是光芒万丈的太阳，直到后来才知道，其实我只是夜晚里的一个萤火虫。</p></li><li><p>开车一路向北，路过一个又一个的城市，一片又一片的农田，村庄和人群，每个人都活得很自由自在，唯独我除外。</p></li><li><p>人生是一个漫长的过程，于你于我都一样，经历过冬夏，享受过春秋，一步一步走到今天，看花开花落，看世事无常，走过去便忘了，预示开始探索未知的世界，这就是人生，从出生开始，随着时间不断的行走，停下脚步，就是死亡。</p></li><li><p>我在森林的深处有一座城堡，每个路过的女孩子都想敲门进来看看，一开始，我激动打开门邀请她们进来，生起炉火，泡一杯热茶，她们听完我的故事，给我一个温暖的拥抱，告诉我一切都会好起来的，然后转身离开。后来，我再没有开过门。因为，我不是一个说故事的人…</p></li></ul>",1),_=[p];function s(o,r,c,d,n,m){return e(),i("div",null,_)}const h=t(a,[["render",s]]);export{u as __pageData,h as default};
